       console.log(data)
  }


  return (
    <div>
               <Checkbox color='primary' onChange={handleChange} value='akash'/>
               <Checkbox color='primary' onChange={handleChange} value='arpit'/>
               <Checkbox color='primary' onChange={handleChange} value='aman'/>
               <Checkbox color='primary' onChange={handleChange} value='xyz' indeterminate/>
    </div>
  )
}
